import React from 'react'
import { H1, BodyMain, MediumText, SmallText } from '../../styles/TextStyles';
import { Card } from '../../styles/CardStyles';
import styled from 'styled-components'

function Home() {
    return (
        <>
            <Wrapper>

                <Bulb1 src="./Vector.svg" />
                <Bulb2 src="./Vector2.svg" />
                <ContentWrapper>
                    <TitleWrapper>
                        <ComputerWork src="./computer-work.svg" />
                        <TextWrapper>    
                            <Title>Hi.<br/>Welcome to<br/>My Website!</Title>
                        </TextWrapper>
                    </TitleWrapper>
                    <InfoCard>
                        <DescriptionWrapper>
                            <ShortDescription>
                                <Avatar />
                                <MediumText>
                                    Tudor Esan 
                                </MediumText>
                                <SmallText> 
                                    Sibiu, Romania
                                </SmallText>
                            </ShortDescription>
                            <MyDescription>
                                Passionate about programming and ways in which technology can improve 
                                our everyday lives. I find Computer Science and Artificial Intelligence 
                                interesting, since abstracting real world problems into code is very 
                                fascinating.
                            </MyDescription>
                        </DescriptionWrapper>
                    </InfoCard>
                </ContentWrapper>
            </Wrapper>
        </>
    )
}

export default Home;

const Rectangle1 = styled.div``
const Rectangle2 = styled.div``


const MyDescription = styled(BodyMain)`
    text-align: center;
    max-width: 80%;
`

const Wrapper = styled.div`
    height: 100%;
`

const InfoCard = styled(Card)`
    position: relative;
    margin: auto ;
    width: 80%;
    padding: 30px;
`

const ComputerWork = styled.img`
    width: 568px;
    height: 420px;
    left: calc(50% - 568px/2 - 202.5px);
    justify-content: center;
    align-content: center;
`

const Bulb1 = styled.img`
    position: absolute;
    left: 0%;
    top: 0%;
    width: 100%;
    z-index: -10;
`
const Bulb2 = styled.img`
    position: absolute;
    left: 0%;
    top: 0%;
    width: 100%;
    z-index: -100;
`

const ContentWrapper = styled.div`
    max-width: 1234px;
    margin: 0 auto;
    padding: 200px 30px;
`

const TitleWrapper = styled.div`
    display: grid;
    position: realtive;
    grid-column-gap: 20px;
    grid-template-columns: 50% 50%;

`
const TextWrapper = styled.div`
    max-width: 360px;
    display: grid;
    grid-gap: 30px;
    justify-content: center;
    align-content: center;
`

const ShortDescription = styled.div`
    display: grid;
    grid-template-rows: auto auto auto;
    justify-items: center;
    grid-gap: 4px;
`

const DescriptionWrapper = styled.div`
    display: grid;
    justify-items: center;
    grid-template-rows: auto auto;
    grid-gap: 30px;
`

const Avatar = styled.div`
    border-radius: 50%;
    width: 150px;
    height: 150px;
    margin: 5px;
    background: url("/MyPhoto.jpg");
    background-position: 12px -5px;
    background-size: cover;
    box-shadow: 0px 5px 10px rgba(0, 0, 0, 0.25);

`

const Title = styled(H1)`
    color: white;
`
